@register(Aggregated_Charts_Data_Yearly)
class A4():
    # 'Aggregated_Charts_Data_Yearly'!A4
    value = "Charts Data M1"
    formula = '''=MID(_xlfn.FORMULATEXT(C4),3,FIND("!",_xlfn.FORMULATEXT(C4))-4)'''
    @eval_fn
    def A4():
        c4_1 = Aggregated_Charts_Data_Yearly.C4.formula #()
        var_1 = FORMULATEXT(c4_1)
        c4_2 = Aggregated_Charts_Data_Yearly.C4.formula #()
        var_2 = FORMULATEXT(c4_2)
        var_3 = FIND("!", var_2)
        var_4 = sub(var_3, 4)
        var_5 = MID(var_1, 3, var_4)
        return var_5

