    def A6():
        c6_1 = Aggregated_Charts_Data_Yearly.C6.formula #()
        var_1 = FORMULATEXT(c6_1)
        c6_2 = Aggregated_Charts_Data_Yearly.C6.formula #()
        var_2 = FORMULATEXT(c6_2)
        var_3 = FIND("!", var_2)
        var_4 = sub(var_3, 4)
        var_5 = MID(var_1, 3, var_4)
        return var_5

