    @eval_fn
    def A49():
        c49_1 = Aggregated_Charts_Data_Yearly.C49.formula #()
        var_1 = FORMULATEXT(c49_1)
        c49_2 = Aggregated_Charts_Data_Yearly.C49.formula #()
        var_2 = FORMULATEXT(c49_2)
        var_3 = FIND("!", var_2)
        var_4 = sub(var_3, 4)
        var_5 = MID(var_1, 3, var_4)
        return var_5

