    def A111():
        c111_1 = Aggregated_Charts_Data_Yearly.C111.formula #()
        var_1 = FORMULATEXT(c111_1)
        c111_2 = Aggregated_Charts_Data_Yearly.C111.formula #()
        var_2 = FORMULATEXT(c111_2)
        var_3 = FIND("!", var_2)
        var_4 = sub(var_3, 4)
        var_5 = MID(var_1, 3, var_4)
